import React from "react";

import styles from "./Button.module.css";

const Button = (props) => {
  return (
    <div className={styles.button}>
      <button
        type={props.type}
        className={props.className}
        onClick={props.onClick}
      ></button>
    </div>
  );
};

export default Button;
